import "./styles.css";
import React from "react";
import { FormattedMessage } from "react-intl";
import { usePalette } from "react-palette";
import Card from "../../components/Card";
import imgPath from "../../assets/images/breakingBingo.png";

const Projects = () => {
  const { data, loading, error } = usePalette(imgPath);
  return (
    <>
      <div className='d-flex flex-column justify-content-center align-items-center min-vh-100 mt-5'>
        <Card title='Breaking Bingo' bgColor={data.lightVibrant} />
        <Card title='Impressentation' />
        <Card title='Der Markt' />
      </div>
    </>
  );
};

export default Projects;
